import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    const screenshots = [];
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // First add an item to cart to ensure there's something to remove
    await page.evaluate(() => {
        window.addToCart(1); // Add product with ID 1 to cart
    });

    // Wait for cart to update
    await page.waitForFunction(() => {
        const cart = document.querySelector('.cart');
        return cart && !cart.textContent.includes('0 Cart');
    }, { timeout: 5000 });

    // Open cart modal
    await page.click('.cart');
    await page.waitForSelector('#cartModal', { state: 'visible', timeout: 5000 });

    // Take screenshot of cart with item
    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_cart_with_item.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_cart_with_item.png'));

    // Remove item from cart
    await page.click('.remove-item');

    // Wait for cart to be empty
    await page.waitForFunction(() => {
        const cart = document.querySelector('.cart');
        return cart && cart.textContent.includes('0 Cart');
    }, { timeout: 5000 });

    // Take screenshot of empty cart
    await page.screenshot({ path: path.join(screenshotsDir, 'step_3_empty_cart.png') });
    screenshots.push(path.join(screenshotsDir, 'step_3_empty_cart.png'));

    return {
      success: true,
      action: "Successfully removed item from cart",
      extractedData: {
        cartCount: 0
      },
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to remove item from cart",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}
